ndpoint_message:"Mensagem",com_endpoint_message_not_appendable:"Edite sua mensagem ou Regenerar.",com_endpoint_default_blank:"padrão: em branco",com_endpoint_default_false:"padrão: falso",com_endpoint_default_creative:"padrão: criativo",com_endpoint_default_empty:"padrão: vazio",com_endpoint_default_with_num:"padrão: {0}",com_endpoint_context:"Contexto",com_endpoint_tone_style:"Estilo de Tom",com_endpoint_token_count:"Contagem de Tokens",com_endpoint_output:"Saída",com_endpoint_context_tokens:"Máximo de Tokens de Contexto",com_endpoint_context_info:"O número máximo de tokens que podem ser usados para contexto. Use isso para controlar quantos tokens são enviados por solicitação. Se não especificado, usará os padrões do sistema com base no tamanho do contexto dos modelos conhecidos. Definir valores mais altos pode resultar em erros e/ou maior custo de tokens.",com_endpoint_google_temp:"Valores mais altos = mais aleatório, enquanto valores mais baixos = mais focado e determinístico. Recomendamos alterar isso ou Top P, mas não ambos.",com_endpoint_google_topp:"Top-p altera como o modelo seleciona tokens para saída. Os tokens são selecionados dos mais prováveis (veja o parâmetro topK) até os menos prováveis até que a soma de suas probabilidades atinja o valor top-p.",com_endpoint_google_topk:"Top-k altera como o modelo seleciona tokens para saída. Um top-k de 1 significa que o token selecionado é o mais provável entre todos os tokens no vocabulário do modelo (também chamado de decodificação gananciosa), enquanto um top-k de 3 significa que o próximo token é selecionado entre os 3 tokens mais prováveis (usando temperatura).",com_endpoint_google_maxoutputtokens:"Número máximo de tokens que podem ser gerados na resposta. Especifique um valor mais baixo para respostas mais curtas e um valor mais alto para respostas mais longas. Nota: os modelos podem parar antes de atingir esse máximo.",com_endpoint_google_custom_name_placeholder:"Defina um nome personalizado para o Google",